import React, { useRef } from "react";

const Projects = () => {
  const scrollContainerRef = useRef(null);

  const scrollLeft = () => {
    if (scrollContainerRef.current) {
      scrollContainerRef.current.scrollBy({
        left: -300,
        behavior: "smooth",
      });
    }
  };

  const scrollRight = () => {
    if (scrollContainerRef.current) {
      scrollContainerRef.current.scrollBy({
        left: 300,
        behavior: "smooth",
      });
    }
  };

  return (
    <section id="projects">
      <div>
        <h1 className="mono">Some things I built</h1>

        <button className="arrow arrow-left" onClick={scrollLeft}>
          &#9664;
        </button>
        <button className="arrow arrow-right" onClick={scrollRight}>
          &#9654;
        </button>

        <div className="scroll-container" ref={scrollContainerRef}>
          <div>
            <h4>Fordham PD</h4>
            <img src="img/proj1.jpg" height="150px" alt="" />
            <p>
              Fordham People Watcher (naming is not my strongest skill) is a
              device that detects the capacity of a room using a Raspberry Pi
              and multiple detectors like motion, humidity, and temperature. The
              readings are then posted to a website that students can use.
            </p>
            <p>
              <em>Hardware</em> <em>Raspberry Pi</em> <em>C++</em>
            </p>
          </div>

          <div>
            <h4>D.A.I.S.Y.</h4>
            <img src="img/proj2.png" height="150px" alt="" />
            <p>
              Daisy was my main summer project and my first experience with AI.
              the name DAISY stands for Developed Artificial Intelligence Yett
              (Again, names not that good). It is an AI bot that answers
              questions. I built the Text recognition algorithm and the
              capability to scrape the web and find answers.
            </p>
            <p>
              <em>Python</em> <em>C++</em> <em>Swift</em>
            </p>
          </div>

          <div>
            <h4>Fighting Robot</h4>
            <img src="img/proj3.jpg" height="150px" alt="" />
            <p>
              I had a phase last summer where I wanted to create a fighting
              robot; no questions, please. This is why I made a mockup for a 3D
              printed fighting robot that used only 4 motors and was controlled
              with a controller. Sadly, the project came to an end when it fell
              off the table.
            </p>
            <p>
              <em>Hardware</em> <em>Python</em>
            </p>
          </div>

          <div>
            <h4>Portfolio Website</h4>
            <img src="img/proj4.jpg" height="150px" alt="" />
            <p>
              This website, Ta-Da! It is built using HTML, CSS, and JS. I've
              created this website portfolio after long nights of figuring out
              text-align and how to center a div. I've deepened my knowledge of
              the 3 languages and Git in the process.
            </p>
            <p>
              <em>HTML</em> <em>CSS</em> <em>JavaScript</em>
            </p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
